snippet.description:
Zamów album: https://preorder.pl/epis-vin-vinci
Sprawdź w digitalu: https://digitalmusic.lnk.to/vinvinciepisdymknfphonocozabitatras

Vin Vinci i Epis prezentują kolejny singiel z długo wyczekiwanego, wspólnego albumu „AMIGOS”. Pozostając w hiszpańskich klimatach, swój kolejny utwór zatytułowali „Atras”, co dosłownie oznacza „wstecz”. Artyści cofają się do wspomnień – także tych rodzinnych – jednak robią to na nietypowym jak na tę tematykę, dynamicznym bicie. Efekt? Połączenie energii z refleksją, które w ich wykonaniu zawsze spotyka się z najlepszym odbiorem wśród słuchaczy.

Vin Vinci na FB: https://www.facebook.com/VinVinciRecords
Vin Vinci na IG: https://www.instagram.com/vin_vinci_official
Vin Vinci INFO: https://bio.to/vinvinci

